export const lightheme = {
    bgColor: "#f8f7f4",
    textColor: "#31302e",
    accentColor: "#9c88ff",
};

export const darkTheme = {
    bgColor: '#1e1e22',
    textColor: '#ccc',
    accentColor: '#9c88ff',
}

export const theme = {
    lightheme,
    darkTheme,
};

export default theme;
